import React from 'react';

const Contacts = () => {
  return (
      <div className="social d-flex align-items-center justify-content-center">
        <a href="https://github.com/ValentinaPasqual" target="_blank" rel="noopener noreferrer"><i className="bi bi-github"></i></a>
        <a href="https://twitter.com/valepasqual" target="_blank" rel="noopener noreferrer"><i className="bi bi-twitter"></i></a>
        <a href="https://www.linkedin.com/in/valentina-pasqual-96791017b/" target="_blank" rel="noopener noreferrer"><i className="bi bi-linkedin"></i></a>
        <a href="https://scholar.google.com/citations?user=EVUFJkAAAAAJ&hl" target="_blank" rel="noopener noreferrer"><i className="ai ai-google-scholar"></i></a>
        <a href="https://figshare.com/authors/Valentina_Pasqual/10212998" target="_blank" rel="noopener noreferrer"><i className="ai ai-figshare"></i></a>
        <a href="https://orcid.org/0000-0001-5931-5187" target="_blank" rel="noopener noreferrer"><i className="ai ai-orcid"></i></a>
      </div>
  );
};

export default Contacts;
